class DossierMedical extends Component {
    constructor(props) {
        super(props);
        this.state = {
            page: '',
            id: '',
            date_naissance: ''
        };
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({ date_naissance: event.target.value });
        this.setState({ id: 152 });
    }
    handleSubmit(event) {
        alert('ity izao ny valuer ato :' + this.state.date_naissance);
        if (this.state.date_naissance.value == null) {
            alert('Ampio valeur fa tsy mety izao');
        }
        else {

            alert('A name was submitted: ' + this.state.date_naissance);
            let url = "DossierMedicalAdulte";
            this.props.history.push(url);
        }
        event.preventDefault();
    }

    render() {
        let page;
        if (this.state.page.value == null) {
            page = <formDateNaissance />;
        } else {
            page = <DossierMedicalAdulte />;
        }
        return (
            <div>
                <div className="container d-flex p-md-0">
                    <ComponentsSidebar />
                    <formDateNaissance />
                    {page}
                </div>
            </div>
        );
    }
}


export default DossierMedical;
